import React from "react";
import classes from "./Items.module.css";

export default function Navigation({ name, amount, price, img_url }) {
  return (
    <div className={classes.item}>
      <p>{name}</p>
      {amount > 0 ? <p>amount</p> : <></>}
      <p>{price}</p>
      <img src={img_url}></img>
    </div>
  );
}
